import React, { useEffect, useState } from 'react';
import { useNavigate, useParams, Link } from 'react-router-dom';
import api from '../services/api';

export default function NovoPet() {
  const navigate = useNavigate();
  const { id } = useParams();
  const [form, setForm] = useState({
    nome: '',
    especie: 'Cachorro',
    raca: '',
    idade: '',
    peso: '',
    porte: '',
    sexo: '',
    cor: '',
    castrado: false,
    carteiraVacinacao: false,
    tutor: '',
    dono: '',
    criador: '',
    observacoes: ''
  });
  const [tutores, setTutores] = useState([]);
  const [donos, setDonos] = useState([]);
  const [admins, setAdmins] = useState([]);

  useEffect(() => {
    api.get('/tutores').then(res => setTutores(res.data));
    api.get('/donos').then(res => setDonos(res.data));
    api.get('/admins').then(res => setAdmins(res.data));

    if (id) {
      api.get(`/pets/${id}`).then(res => setForm(res.data));
    }
  }, [id]);

  const handleChange = (e) => {
    const { name, value, type, checked } = e.target;
    setForm({ ...form, [name]: type === 'checkbox' ? checked : value });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    try {
      if (id) {
        await api.put(`/pets/${id}`, form);
      } else {
        await api.post('/pets', form);
      }
      navigate('/pets');
    } catch (err) {
      alert('Erro ao salvar pet');
    }
  };

  return (
    <div className="container mt-4">
      <div className="d-flex justify-content-between align-items-center mb-3">
        <Link to="/pets" className="btn btn-secondary">← Voltar</Link>
        <h2>{id ? 'Editar Pet' : 'Cadastrar Novo Pet'}</h2>
      </div>

      <form onSubmit={handleSubmit}>
        <div className="row">
          {['nome', 'idade', 'peso', 'cor', 'observacoes'].map((field) => (
            <div className="mb-3 col-md-6" key={field}>
              <label className="form-label">{field.charAt(0).toUpperCase() + field.slice(1)}</label>
              <input
                type="text"
                className="form-control"
                name={field}
                value={form[field] || ''}
                onChange={handleChange}
                required={field !== 'observacoes'}
              />
            </div>
          ))}

          <div className="mb-3 col-md-4">
            <label className="form-label">Raça</label>
            <select name="raca" className="form-select" value={form.raca} onChange={handleChange} required>
              <option value="">Selecione</option>
              {["Labrador", "Bulldog", "Poodle", "Golden Retriever", "Beagle", "Shih Tzu", "Boxer"].map(r => (
                <option key={r} value={r}>{r}</option>
              ))}
            </select>
          </div>

          <div className="mb-3 col-md-4">
            <label className="form-label">Porte</label>
            <select name="porte" className="form-select" value={form.porte} onChange={handleChange} required>
              <option value="">Selecione</option>
              {["Pequeno", "Médio", "Grande"].map(p => (
                <option key={p} value={p}>{p}</option>
              ))}
            </select>
          </div>

          <div className="mb-3 col-md-4">
            <label className="form-label">Sexo</label>
            <select name="sexo" className="form-select" value={form.sexo} onChange={handleChange} required>
              <option value="">Selecione</option>
              {["Macho", "Fêmea"].map(s => (
                <option key={s} value={s}>{s}</option>
              ))}
            </select>
          </div>

          {["castrado", "carteiraVacinacao"].map(field => (
            <div className="form-check mb-3 col-md-6" key={field}>
              <input
                className="form-check-input"
                type="checkbox"
                name={field}
                checked={form[field] || false}
                onChange={handleChange}
              />
              <label className="form-check-label">{field === 'castrado' ? 'Castrado' : 'Carteira de Vacinação em Dia'}</label>
            </div>
          ))}

          {[{ label: 'Tutor', key: 'tutor', list: tutores }, { label: 'Dono', key: 'dono', list: donos }, { label: 'Criador (Admin)', key: 'criador', list: admins }].map(ref => (
            <div className="mb-3 col-md-4" key={ref.key}>
              <label className="form-label">{ref.label}</label>
              <select className="form-select" name={ref.key} value={form[ref.key]} onChange={handleChange} required>
                <option value="">Selecione</option>
                {ref.list.map(item => (
                  <option key={item._id} value={item._id}>{item.nome}</option>
                ))}
              </select>
            </div>
          ))}
        </div>

        <button type="submit" className="btn btn-primary">Salvar</button>
      </form>
    </div>
  );
}
